    false,nt"url": null,nt"notes": "This progress report documents the use
    of sandbar and side-channel habitats by shorebird and attempts to show trends exhibited
    during this first year of fieldwork. Four sandbars and three side channel habitats
    were sampled on the lower Missouri River between river miles 182-282. Shorebird
    numbers peaked during the latter part of July with a smaller peak in September.
    This report concluded there is no overall trend that shows shorebird preference
    for main channel or side channel habitats.",nt"license_title": "License Not
